import React from 'react';

function TodoList (props) {

    let tasksArr = props.tasksObj;

    let todoList = tasksArr.map( (task) => {
        console.log(task);
        return(<li>{task.taskContent}</li>)
    })

    return(
        <div className='tasks-list'>
            <ul>
                {todoList}
            </ul>
        </div>
    )
}

export default TodoList;
